import React from 'react'
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'

const App = () => {
  return (
    <React.Fragment>
       <h1 className="text-center">This is my channel</h1>
    </React.Fragment>
  )
}
export default App;
